import React from 'react';
import './App.css';
import {Switch,Route} from 'react-router-dom';

import HomePage from './pages/homepage.component'

const hats = () => {
  return (
    <div>
      <h1>Hats</h1>
    </div>
  );
}

function App() {
  return (
    <div>
      <Route exact path="/" component={HomePage}/>
    </div>
  );
}

export default App;
